import Menu from "../menu";

const Importpage = () => {
    return (
        <div class="app">
            <div class="importpage">
                <h1>Import Page</h1>
                <div class="importcontainer">
                    <h3>匯入資料</h3>
                    <input type="file" accept=".json, .csv" />
                </div>
            </div>
            <Menu />
        </div>
    )
}

export default Importpage;
